import pandas as pd

# Load the dataset to examine its structure
file_path = 'BankChurners.csv'
df = pd.read_csv(file_path)

# Display the first few rows to understand the dataset's structure

df.head()

df.info()

col_to_drop = df.columns[[16,21,22,20,12,15,19]]
df = df.drop(col_to_drop,axis=1)

df.info()

import pandas as pd
from sklearn.model_selection import train_test_split
from sklearn.preprocessing import StandardScaler, LabelEncoder
from sklearn.linear_model import LogisticRegression
from sklearn.metrics import confusion_matrix, accuracy_score, precision_score, recall_score, f1_score, roc_curve, auc
import matplotlib.pyplot as plt
import seaborn as sns

# Step 1: Encode categorical variables
label_enc = LabelEncoder()
col_to_encode = ['Attrition_Flag','Gender','Education_Level','Marital_Status','Income_Category','Card_Category']
df[col_to_encode] = df[col_to_encode].apply(lambda col: label_enc.fit_transform(col))


# Step 2: Feature Scaling
scaler = StandardScaler()

# Select features (excluding CLIENTNUM as it's just an ID)
X = df[['Customer_Age', 'Gender', 'Dependent_count', 'Education_Level', 'Marital_Status',
        'Income_Category', 'Card_Category', 'Months_on_book', 'Total_Relationship_Count',
        'Months_Inactive_12_mon', 'Credit_Limit', 'Total_Revolving_Bal', 'Total_Trans_Amt',
        'Total_Trans_Ct']]

# Scale the features
X_scaled = scaler.fit_transform(X)

# Target variable
y = df['Attrition_Flag']

"""**2. Split the Dataset**

Split the dataset into training and testing sets.
"""

X_train, X_test, y_train, y_test = train_test_split(X_scaled, y, test_size=0.2, random_state=42)

"""**3. Train the Logistic Regression Model**

Train the logistic regression model using the training set.
"""

log_model = LogisticRegression()
log_model.fit(X_train, y_train)

# Step 5: Predict on the test set
y_pred = log_model.predict(X_test)

"""**4. Evaluate the Model**

Now, evaluate the model using confusion matrix, accuracy, precision, recall, and F1-score.
"""

# Step 5: Evaluation metrics
conf_matrix = confusion_matrix(y_test, y_pred)
accuracy = accuracy_score(y_test, y_pred)
precision = precision_score(y_test, y_pred)
recall = recall_score(y_test, y_pred)
f1 = f1_score(y_test, y_pred)

print(f'Confusion Matrix:\n{conf_matrix}')
print(f'Accuracy: {accuracy}')
print(f'Precision: {precision}')
print(f'Recall: {recall}')
print(f'F1-Score: {f1}')

"""**5. Plot the ROC Curve and Calculate AUC**"""

y_pred_prob = log_model.predict_proba(X_test)[:, 1]

fpr, tpr, thresholds = roc_curve(y_test, y_pred_prob)
roc_auc = auc(fpr, tpr)

plt.figure(figsize=(5,3))
plt.plot(fpr, tpr, color='darkorange', lw=2, label=f'ROC curve (AUC = {roc_auc:.2f})')
plt.plot([0, 1], [0, 1], color='navy', lw=2, linestyle='--')
plt.xlim([0.0, 1.0])
plt.ylim([0.0, 1.05])
plt.xlabel('False Positive Rate')
plt.ylabel('True Positive Rate')
plt.title('Receiver Operating Characteristic (ROC)')
plt.legend(loc='lower right')
plt.show()